  false,\n\t\"url\": null,\n\t\"notes\": \"The Wildlife Management Study - Project
  No. 2 dated May 15, 1969 was developed to evaluate the production of moist soil
  food plants in the Mississippi River flood plain and their subsequent use by waterfowl.
